import React from 'react';
import {Button, ToggleButton, Tooltip} from '@mui/material';
import DarkModeOutlinedIcon from '@mui/icons-material/DarkModeOutlined';
import LightModeOutlinedIcon from '@mui/icons-material/LightModeOutlined';
import GitHubIcon from '@mui/icons-material/GitHub';
import SearchBar from './searchbar';


function Navbar() {
  return (
    <nav class="nav-bar">
      <div class="nav-bar-content">
        <div class="nav-bar-left">
          <Button class="nav-bar-button-left">Home</Button>
          <Button class="nav-bar-button-left">Favourites</Button>
        </div>
        <div class="nav-bar-right">
          <Tooltip title="Turn on light mode">
            <Button class="nav-bar-button-right" variant="outlined">
              <DarkModeOutlinedIcon/>
            </Button>
          </Tooltip>

          <Tooltip title="GitHub repository">
            <Button class="nav-bar-button-right" variant="outlined">
              <GitHubIcon/>
            </Button>
          </Tooltip>

          <SearchBar/>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
